INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (7, "ペコリーヌとの出会い", "フリーマーケット会場", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 91002, 10118, "青空の下で謁見", 2834, 0, 0, 1, 2, 40, 5118061, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (7, "マホとの出会い", "フリーマーケット会場", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 91002, 10118, "未来の騎空団\nマスコット？", 2835, 0, 0, 1, 2, 40, 5118062, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (7, "アキノとの出会い", "ランドソル市街地", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 91002, 10118, "お嬢さまからの\n緊急依頼", 2837, 0, 0, 1, 2, 40, 5118063, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (18, "ジュンとの出会い", "フリーマーケット会場", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 91002, 10118, "黄金色の悩みごと", 4108402, 0, 0, 1, 2, 40, 5118064, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (18, "カオリとの出会い", "フリーマーケット会場", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 91002, 10118, "白熱！　格闘大会！", 4107402, 0, 0, 1, 2, 40, 5118065, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (16, "ニノンとの出会い", "オーエド町", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 91002, 10118, "祭り太鼓はオーエドの華", 9000227, 1, 0, 1, 2, 40, 5118066, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (19, "スズナとの出会い", "フリーマーケット会場", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 91002, 10118, "人気者は遅れて\nやってくる", 2101181, 0, 0, 1, 3, 40, 5118067, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (18, "ナナカとの出会い", "ランドソル市街地", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 91002, 10118, "巫女・ミーツ・魔法少女", 4109402, 0, 0, 1, 3, 40, 5118068, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (18, "キャル＆コッコロとの出会い", "フリーマーケット会場", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 91002, 10118, "ネズ耳は二度なくなる", 4305402, 0, 0, 1, 3, 40, 5118069, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (18, "ユカリとの出会い", "ランドソル市街地", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 91002, 10118, "この出会いにカンパイ！", 4101402, 0, 0, 1, 3, 40, 5118070, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (18, "アオイとの出会い", "ランドソル市街地", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 91002, 10118, "陰陽アンサンブル", 4106402, 0, 0, 1, 3, 40, 5118071, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (7, "シノブとの出会い", "フリーマーケット会場", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 91002, 10118, "運試し十番勝負！", 2836, 1, 0, 1, 3, 40, 5118072, 8);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, "オープニング", 0, 0, 0, 10118, "彼女たちの新たな日常", 0, 0, 10145115, 0, 1, 0, 5118600, 0);
